VUE/计算属性vs方法vs侦听属性.html.body:
计算属性vs方法vs侦听属性
计算属性vs方法

计算属性：vue的计算属性是基于他们的响应式依赖进行缓存的，只有在相关的响应式依赖发生改变时才会重新求值，即只要相关响应式依赖不发生改变，多次访问计算属性只会返回上次求值的结果而不会再次执行函数
方法：每当触发重新渲染时，调用方法将总会再次执行函数。

计算属性vs侦听属性

计算属性可以依赖好几个响应式的数据，watch只能监听一个数据改变
当需要在数据变化时执行异步或开销较大的操作时，watch方式是最有用的
vm.$watch(a,b,c)
a:表达式或计算属性函数，观察 Vue 实例变化的一个表达式或计算属性函数,表达式只接受监督的键路径
b:回调函数,得到的参数为新值和旧值
c:选项
deep
immediatevm.$watch('someObject', callback, {
deep: true
});
vm.someObject.nestedValue = 123;
vm.$watch 返回一个取消观察函数，用来停止触发回调：var unwatch = vm.$watch('a', cb);
// 之后取消观察
unwatch();

VUE/prop相关.html.body:
prop相关

prop形式：

1.数组形式：props: ['title', 'likes', 'isPublished', 'commentIds', 'author']
2.对象形式：props: {
title: String,
// 基础的类型检查 (`null` 和 `undefined` 会通过任何类型验证)
propA: Number,
// 多个可能的类型
propB: [String, Number],
// 必填的字符串
propC: {
  type: String,
  required: true
},
// 带有默认值的数字
propD: {
  type: Number,
  default: 100
},
// 带有默认值的对象
propE: {
  type: Object,
  // 对象或数组默认值必须从一个工厂函数获取
  default: function () {
    return { message: 'hello' }
  }
},
// 自定义验证函数
propF: {
  validator: function (value) {
    // 这个值必须匹配下列字符串中的一个
    return ['success', 'warning', 'danger'].indexOf(value) !== -1
  }
}
}



1.注意：如果prop 以一种原始的值传入且需要进行转换。在这种情况下，最好使用这个 prop 的值来定义一个计算属性

2.注意在 JavaScript 中对象和数组是通过引用传入的，所以对于一个数组或对象类型的 prop 来说，在子组件中改变这个对象或数组本身将会影响到父组件的状态。

