process全局变量，不需require可直接使用，提供当前Node.js进程的有关信息，并控制Node.js进程，process.argv 属性返回一个数组，这个数组包含了启动Node.js进程时的命令行参数

koa/koa学习笔记.html.body:
koa学习笔记

调用app.use的顺序决定了中间件的顺序
router是为了处理url
bodyparser解析元素的request对象的body，并绑定到ctx.request.body中
bodyparser必须在router之前被注册到app对象上
设置跨域//设置跨域访问中间件
app.use(async (ctx, next)=> {
 ctx.set('Access-Control-Allow-Origin', '*');
 ctx.set('Access-Control-Allow-Headers', 'Content-Type, Content-Length, Authorization, Accept, X-Requested-With , yourHeaderFeild');
 ctx.set('Access-Control-Allow-Methods', 'PUT, POST, GET, DELETE, OPTIONS');
 if (ctx.method == 'OPTIONS') {
   // post请求的请求确认
   ctx.response.body = {
     subCode: 'SUCCESS',
     msg: '',
     data: ''
   }
 } else {
   await next();
 }
});

MongoDB/MongoDB学习笔记.html.body:
MongoDB学习笔记

安装地址：https://www.mongodb.com/download-center/community
安装后在C盘创建data\db目录
配置环境变量
此电脑-》属性-》高级系统设置-》高级-》环境变量-》找到path-》编辑-》新建-》填入mongo安装的bin目录-》命令行运行'mongo'
运行mongo命令默认连接的是test库
admin: root数据库，此数据库的用户自动继承所有数据库的权限；local数据库的数据永远不会被复制；config数据库在mongo分片设置时用于保存分片信息
capped collections：固定大小的集合，按照数据的插入顺序保存，在磁盘中也是按照插入顺序存放
常用基础命令
// 显示所有数据库列表
show dbs
// 切换、创建数据库
use tangjj
// 显示当前数据库
db
// 插入数据(只有往数据库中插入数据才算是真正创建了数据库)，在 MongoDB 中，你不需要创建集合。当你插入一些文档时，MongoDB 会自动创建集合
db.tangjj.insert({"name": "隔壁小花"})
// 删除数据库
db.dropDatabase();
// 创建集合
db.createCollection('list')
// 显示集合
show tables或show collections
// 删除集合
// db.list.drop()

vscode/task.html.body:
task
vscode可以自定义task完成一些代码或者项目生成，编译，测试，打包等的工作。通过这种方式完成代码生产自动化，可以在做这些事情时不用临时再敲命令，或者写代码。

创建task任务

Terminal->Configure Tasks-> 随便点击一个就会生成 .vscode/tasks.json 文件

修改tasks.json，创建监听typescript的task监听

{
    "version": "2.0.0",
    "tasks": [
    {
      "type": "typescript",
      "tsconfig": "tsconfig.json",
      "option": "watch",
      "problemMatcher": [
        "$tsc-watch"
      ],
      "group": {
        "kind": "build",
        "isDefault": true
      },
      "label": "tsc: watch - tsconfig.json"
    }
  ]
}

ctrl + shift + B启动任务
